import React from 'react';

// Define propertyData or import it from another file
const propertyData = {
  // Property data here
};

const PropertyCard = ({ property, onCloseForm }) => {
  const handleCloseClick = () => {
    onCloseForm();
  };

  return (
    <div className="property-card">
      {/* Displaying the first image */}
      <img className="property-image" src={property.image1} alt={property.title} />

      {/* Displaying property details */}
      <div className="property-details">
        <h3>{property.title}</h3>
        <p>{property.description}</p>
        <p>Цена: {property.price}</p>
        {/* Property data */}
        <button onClick={handleCloseClick}>Close Form</button>
      </div>
    </div>
  );
};

export default PropertyCard;
